import React from "react";
import "../../App.css";
import Aos from "aos";
import "aos/dist/aos";
import { useEffect } from "react";
import { Container, Grid } from "@material-ui/core";

export default function Products() {
  useEffect(() => {
    Aos.init({ duration: 2000 });
  }, []);
  return (
    <div>
      <div className="urunler"></div>
      <Container>
        <Grid container spacing={5} direction="coloumn" md={6} sm={6} xs={12}>
          <Grid item>1</Grid>
          <Grid item>2</Grid>
          <Grid item>3</Grid>
          <Grid item>4</Grid>
          <Grid item>5</Grid>
          <Grid item>6</Grid>
        </Grid>
      </Container>
    </div>
  );
}
